import React, { Component } from 'react';
import { withRouter } from 'react-router';

import { UsersForm } from '../../components/Users';

import { ReactComponent as SvgDraw } from '../../assets/undraw_short_bio_e5pg.svg';

import {
  Columns,
  Column,
  Level,
  LevelLeft
} from 'bloomer';

import {
  Title
} from 'shipnow-mercurio'

class UserCreation extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <React.Fragment>
        <Level>
          <LevelLeft>
            <Title>Nuevo usuario</Title>
          </LevelLeft>
        </Level>
        <hr/>
        <Columns>
          <Column isSize={ 4 } className="pl-5 pr-5">
            <UsersForm />
          </Column>
          <Column isSize={ 2 }></Column>
          <Column isSize={ 6 } clasName="has-text-centeres">
            <SvgDraw style={{ height: '75%', width: '75%'}}/>
          </Column>
        </Columns> 
      </React.Fragment> )
  }
}

export default UserCreation;
